<html>
<head>
<title>Colorized Diff</title>
</head>
<style>
.diffdiv  { border: solid 1px black;           }
.comment  { color: gray;                       }
.diff     { color: #8A2BE2;                    }
.minus3   { color: blue;                       }
.plus3    { color: maroon;                     }
.at2      { color: lime;                       }
.plus     { color: green; background: #E7E7E7; }
.minus    { color: red;   background: #D7D7D7; }
.only     { color: purple;                     }
</style>
<body>
<pre>
<span class="comment"><span class="minus3">--- correctOutput/fibonacci_iterative.s5	2015-02-09 13:34:57.947168000 +0100</span>
<span class="plus3">+++ testOutput/fibonacci_iterative.s5	2015-02-12 15:48:51.191110000 +0100</span>
<span class="at2">@@ -54,3 +54,4 @@</span>
       VARIABLE()("f")()
     RETURN_STATEMENT()()
      CONSTANT(INT)(0)()
<span class="plus">+  (nil)</span></span>
</pre>
</body>
</html>
